Insert into  PRODUCT_INFORMATION (PRODUCT_ID,PRODUCT_NAME,PRODUCT_DESCRIPTION,CATEGORY_ID,WEIGHT_CLASS,SUPPLIER_ID,PRODUCT_STATUS,LIST_PRICE,MIN_PRICE,CATALOG_URL) values (2400,'DIMM - 512 MB','512 MB DIMM memory. Improved memory upgrade granularity: Fewer DIMMs are required to upgrade a system than it would require if using SIMMs in the same system. Increased maximum memory ceilings: Given the same number of memory slots, the maximum memory of a system using DIMMs is more than one using SIMMs. DIMMs have separate contacts on each side of the board, which provide two times the data rate as one SIMM.',14,1,102098,'under development',448,380,'http://www.supp-102098.com/cat/hw/p2400.html');
Insert into  PRODUCT_INFORMATION (PRODUCT_ID,PRODUCT_NAME,PRODUCT_DESCRIPTION,CATEGORY_ID,WEIGHT_CLASS,SUPPLIER_ID,PRODUCT_STATUS,LIST_PRICE,MIN_PRICE,CATALOG_URL) values (1763,'DIMM - 64MB','Memory DIMM: RAM, 64MB (100-MHz Unregistered ECC SDRAM)',14,1,102069,'orderable',247,202,'http://www.supp-102069.com/cat/hw/p1763.html');
Insert into  PRODUCT_INFORMATION (PRODUCT_ID,PRODUCT_NAME,PRODUCT_DESCRIPTION,CATEGORY_ID,WEIGHT_CLASS,SUPPLIER_ID,PRODUCT_STATUS,LIST_PRICE,MIN_PRICE,CATALOG_URL) values (2396,'EDO - 32MB','Memory EDO SIM: RAM, 32 MB (100-MHz Unregistered ECC SDRAM). Like FPM, EDO is available on SIMMs and DIMMs, in 3.3 and 5 volt varieties If EDO memory is installed in a computer that was not designed to support it, the memory may not work.',14,1,102051,'orderable',179,149,'http://www.supp-102051.com/cat/hw/p2396.html');
